import React, {Component} from 'react';
import {Link} from 'react-router-dom';
import logo from '../logo.svg';
import img from '../bag.png';
import Cart from '../shop.png';
import styled from 'styled-components';
import {ButtonContainer} from './Button';
import {dropbtn, dropdownContent} from './Dropdown'

export default class Navbar extends Component {
  render() {
    return (
      <NavWrapper className="navbar navbar-expand-sm navbar-dark px-sm-5">
        <Link to='/'>
          <img src={img} alt="store" className="navbar-brand" />
        </Link>
        <ul className="navbar-nav align-items-center">
          <li className="nav-item ml-5">
            <Link to="/" className="nav-link">Products</Link>
          </li>
          <li>
            <Link to="/login" className="nav-link">Login</Link>
          </li>
          <li>
            <button class="dropbtn">Dropdown</button>
              <div class="dropdownContent">
                <a href="#">Link 1</a>
                <a href="#">Link 2</a>
                <a href="#">Link 3</a>
              </div>
          </li>
        </ul>
        <Link to="/cart" className="ml-auto">
          <ButtonContainer>
            <span className="mr-2">
              <img src={Cart} alt="store" className="navbar-brand" />
            </span>
            My Cart
          </ButtonContainer>
        </Link>
      </NavWrapper>
    );
  }
}

const NavWrapper = styled.nav`
background: var(--darkRed);
.nav-link {
  color: var(--white) !important;
  font-size: 1.3rem;
  text-transform: capitalize;
  transition: all 0.2s ease-in-out;
  &:hover {
    background: var(--lightRed);
    background-radius: 0.5rem;
    color: var(--darkRed) !important;
  }
}
`
